    "title": "Vermeend portret van Egbert Gerbrantsz en zijn vrouw",
    "description": "A merchant and his wife warn us of the dangers of wealth. All sorts of objects on the table refer to the husband's occupation and material wellbeing. The cautionary text left places this acquired status in perspective: CEDIT MORS NEMINI (death stops for no one). This moralistic message is strengthened by the hourglass, the skull in the window and the vista of the Crucified Christ, symbols of the transience of this earthly life. The texts on the rear wall underscore the duty to be pious and conduct charitable works. The couple were once thought to be the Amsterdam mayor Egbert Gerbrantsz and his wife, but this is not certain. Written on one of the letters, right, is ‘Mr. Jan Egberts’, possibly the name of the man depicted. Doubt is also cast on the attribution of the double portrait to Dirck Jacobsz, son of the painter Jacob Cornelisz.",
