    "title": "Vermeend portret van Egbert Gerbrantsz en zijn vrouw",
    "description": "Deze koopman en zijn vrouw waarschuwen ons voor de gevaren van de rijkdom. Allerlei voorwerpen op tafel verwijzen naar het beroep en de materiële welstand van de man. De waarschuwende tekst links relativeert de verworven status: CEDIT MORS NEMINI (de dood wijkt voor niemand). Deze moralistische boodschap wordt versterkt door de zandloper, de schedel in het venster en de doorkijk naar de Gekruisigde, symbolen voor de vergankelijkheid van het aardse leven. De teksten op de achterwand onderstrepen de plicht tot vroomheid en liefdadige werken. Vroeger werd aangenomen dat dit echtpaar de Amsterdamse burgemeester Egbert Gerbrantsz en diens vrouw voorstelde. Dit is allerminst zeker. Op één van de brieven rechts staat ‘Mr. Jan Egberts’ geschreven, mogelijk de naam van de voorgestelde man. De toeschrijving van het dubbelportret aan Dirck Jacobsz, zoon van de schilder Jacob Cornelisz, wordt betwijfeld.",
