    "cho": "http://hdl.handle.net/11259/collection.37328",
    "type": "http://browser.aat-ned.nl/300177435",
    "title": "Vermeend portret van Egbert Gerbrantsz en zijn vrouw",
    "description": "Vroeger werd aangenomen dat dit echtpaar de Amsterdamse burgemeester Egbert Gerbrantsz en zijn vrouw voorstelde. Hoewel op één van de brieven rechts 'Mr. Jan Egberts' staat geschreven, is die identificatie allerminst zeker. Over de toeschrijving van het schilderij aan Dirck Jacobsz, zoon van de schilder Jacob Cornelisz, bestaan eveneens twijfels. Maar dit verandert niets aan de diepere boodschap van het schilderij. De koopman en zijn vrouw waarschuwen ons voor de gevaren van rijkdom. Allerlei voorwerpen op tafel verwijzen naar het beroep en de materiële welstand van de man, maar links staat geschreven: CEDIT MORS NEMINI (de dood wijkt voor niemand). De moralistische boodschap wordt versterkt door de zandloper, de schedel in het venster en de doorkijk naar de gekruisigde Christus, symbolen voor de vergankelijkheid van het aardse leven. De teksten op de achterwand onderstrepen de plicht tot vroomheid en liefdadige werken.",
    "beginTimestamp": "1541",
