    "title": "Vermeend portret van Egbert Gerbrantsz en zijn vrouw",
    "description": "A merchant and his wife warn of the dangers that can accompany wealth. Various objects on the table refer to the husband''s occupation and material prosperity. The cautionary text on the left places his status in perspective: CEDIT MORS NEMINI (death stops for no one). This message is emphasised by the hourglass, the skull in the window and the view of the crucified Christ, symbolising the transience of earthly life. The texts on the rear wall accentuate the need for piety and charity. The couple were once thought to be the Amsterdam burgomaster Egbert Gerbrantsz and his wife, but this is no longer certain. Inscribed on one of the letters, right, is ''Mr Jan Egberts'', possibly the name of the man depicted. Doubt has also been cast on the attribution of the double portrait to Dirck Jacobsz, son of the painter Jacob Cornelisz.",
