    "title": "Damrak-print, deel 1 (met o.a. portret tunnelboorder)",
    "description": "Onderdeel van een groot bedrukt zeildoek met Delfts blauw-motief, van kunstenaar Hugo Kaagman. Kaagman maakte het doek in opdracht van Dienst Metro van de gemeente Amsterdam. Tijdens de aanleg van de Noord/Zuidlijn hing het 40 meter lange kunstwerk op het Damrak, om de schuttingen die de bouwwerkzaamheden afschermden een vrolijker aanzien te geven. De voorstelling vormt een mozaïek van deelvoorstellingen en levert een artistiek commentaar op het reilen en zeilen van de stad in de laatste tien jaar. Zo zijn op dit doek de werkzaamheden aan de Noord/Zuidlijn afgebeeld.",
    "beginTimestamp": "2010",
